import Greeting from "../components/Greeting/Greeting";

function handleClick() {
  console.log("will this work?");
}

export default function signup() {
  return (
    <div>
      <header>
        <div className="Little_Greeting">Welcome to Tripster!</div>
        <div className="Greeting_title">Sign up</div>
      </header>

      <div>
        <RegisterForm />
        <Button
          text="Start exploring"
          type="signup"
          click={console.log("clicked!")}
        />
      </div>
      <button onClick={console.log("it just prints once")}> works? </button>
    </div>
  );
}
